import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src='https://c.tenor.com/RMaW_AvtKfQAAAAS/samuel-rodrigues.gif'></img>
        <p>
          no tengo <code>idea</code> de que estoy haciendo.
        </p>
        <a
          className="App-link"
          href="https://github.com/matzu14"
          target="_blank"
          rel="noopener noreferrer"
        >
          Mi polla con cebolla
        </a>
        <a href='/'>s</a>
      </header>
    </div>
  );
}

export default App;
